import React, { useState } from 'react';
import Button from '@mui/material/Button';

function CRUDOp(){
    const list=[
        {
            username: "laqube",
            email:"example1@astanait.edu.kz",
            password: "Qqwerty1!",
            role:"admin"
        },
        {
            username: "homyak",
            email:"example2@astanait.edu.kz",
            password: "Qqwerty1!",
            role:"admin"
        },
        {
            username: "John Doe",
            email:"example3@astanait.edu.kz",
            password: "Doe667",
            role:"user"
        }
    ]
     
    const [lists, setList] = useState(list)
    
    return(
        <div>
            <table>
                {
                    list.map((current)=>(
                        <tr sx={{ height: '100%' }}
                            direction="row"
                            justifyContent="center"
                            alignItems="center"
                            spacing={2}>
                            <td>{current.username}</td>
                            <td>{current.email}</td>
                            <td>{current.role}</td>
                            <td>
                                <Button variant="outlined" color="success" sx={{ mx: 0.5 }}>Edit</Button>
                                <Button variant="outlined" color="error" sx={{ mx: 0.5 }}>Delete</Button>
                            </td>
                        </tr>
                    ))
                }
            </table>
        </div>    
        
    )
} 

export default CRUDOp;
